CREATE TABLE `products` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `product_code` varchar(27) DEFAULT NULL,
  `business_group` varchar(14) DEFAULT NULL,
  `supplier` varchar(11) DEFAULT NULL,
