  `product_group` varchar(13) DEFAULT NULL,
  `category` varchar(20) DEFAULT NULL,
  `brand` varchar(11) DEFAULT NULL,
  `image` varchar(131) DEFAULT NULL,
  `price` varchar(5) DEFAULT NULL,
  `price_krw` varchar(9) DEFAULT NULL,
  `status` varchar(8) DEFAULT NULL,
  `size` varchar(59) DEFAULT NULL,
  `stock` varchar(5) DEFAULT NULL,
  `marketplaces` varchar(71) DEFAULT NULL,
  `product_name` varchar(80) DEFAULT NULL,
  `color` varchar(15) DEFAULT NULL,
  `description` varchar(583) DEFAULT NULL,
  `dimension` varchar(194) DEFAULT NULL,
  `weight` varchar(10) DEFAULT NULL,
  `keyword` varchar(538) DEFAULT NULL,
  `material_english` varchar(86) DEFAULT NULL,
  `material_china` varchar(68) DEFAULT NULL,
  `added_time` date NOT NULL,
  `added_user` varchar(10) NOT NULL,
  `modified_time` date NOT NULL,
  `modified_user` varchar(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1500 DEFAULT CHARSET=utf8;
